INSERT INTO `sys_email_template` VALUES ('building_permit_email_attachment','APPROVED BUILDING PERMIT','Dear <b>${contact.name}</b>, <br>\r\n<br>\r\nWe are happy to inform you that your application for Building Permit is already approved by our office. <br>\r\n<br>\r\nRelative thereto, attached are the advance electronic copies of said permit and the corresponding clearances for your immediate reference. You may now also claim the hard copies of your permit in our office at your most convenient time. <br>\r\n<br>\r\nThank you very much. <br>\r\n<br>\r\n<br>\r\n<b>The Gensan OSCP Team</b>'),('obo_app_claimstub','${doctitle} APPLICATION - CLAIM STUB.','Dear <b>${contact.name}</b>, <br>\r\n\r<br>\nGood day! Please be informed that your application for ${doctitle} with tracking no. ${trackingno} was already accepted. We will now proceed with the technical evaluation process. \r\nFor reference, your application number is \r\n\r<br>\n<h2>${appno}</h2>\r\n\r<br>\nPlease use this number to follow up on the progress of your application. To check the progress of your application\r online, \nyou may visit our website through this link: <a href=\"https://www.filipizen.com/partners/albay_legazpi/services/obo/monitorbuildingpermit?appno=${appno}\">link</a>\r\n<br>\r\n<br>\nRegards, <br>\r\n<br>\n<b>The Gensan OSCP Team</b>'),('obo_assessment','${doctitle} APPLICATION - ORDER OF PAYMENT','Dear <b>${contact.name}</b>, <br>\r\n<br>\r\nThis has reference to your application for ${doctitle} with our office. <br>\r\n<br>\r\nRelative thereto, attached is a copy of the Order of Payment for said application. Kindly pay the necessary fees, through our cashier or online payment in the City\'s website, for us to continue with the processing and approval of your application. <br>\r\n<br>\r\nThank you. <br>\r\n<br>\r\n<br>\r\n<b>The Gensan OSCP Team</b>'),('occupancy_certificate','APPROVED CERTIFICATE OF OCCUPANCY','Dear <b>${contact.name}</b>, <br>\n<br>\nWe are happy to inform you that your application for Certificate of Occupancy is already approved by our office. <br>\n<br>\nRelative thereto, attached are the advance electronic copies of said permit and the corresponding clearances for your immediate reference. You may now also claim the hard copies of your permit in our office at your most convenient time. <br>\n<br>\nThank you very much. <br>\n<br>\n<br>\n<b>The Gensan OSCP Team</b>'),('requirement_transmittal','${doctitle} Requirements Verification','Dear <b>${contact.name}</b>, <br>\n\n<br>\nWe have checked your submitted requirements and found out some deficiencies/lacking documents. <br>\n<br>\nRelative thereto, attached is a copy of the checklist of said deficiencies/lacking documents. Kindly submit them to our office for us to continue the re-evaluation and processing of your application. \n<br>\n<br>\nThank you. <br>\n\n<br>\n<br>\nRegards, <br>\n\n<br>\n<b>The Legazpi OBO Team</b>'),('trade_evaluation_transmittal','TRADE EVALUATION - APPLICATION EVALUATION SHEET','Dear <b>${contact.name}</b>, <br>\n\n<br>\nThis has reference to your application for Building Permit with our office. <br>\n\n<br>\nRelative thereto, attached is a copy of the findings and recommendations of our technical evaluators for the said application. Kindly proceed to our office, retrieve your submitted documents, and make the necessary corrections based on our findings and recommendations. Afterwhich, please return the complete documents with the necessary corrections to our office for us to continue the re-evaluation and processing of your application. <br>\n<br>\nThank you. <br>\n\n<br>\n<br>\nRegards, <br>'),('zoning_evaluation_transmittal','ZONING EVALUATION - APPLICATION EVALUATION SHEET','Dear <b>${contact.name}</b>, <br>\n\n<br>\nThis has reference to your application for Building Permit with our office. <br>\n\n<br>\nRelative thereto, attached is a copy of the findings and recommendations of our technical evaluators for the said application. Kindly proceed to our office, retrieve your submitted documents, and make the necessary corrections based on our findings and recommendations. Afterwhich, please return the complete documents with the necessary corrections to our office for us to continue the re-evaluation and processing of your application. <br>\n<br>\nThank you. <br>\n\n<br>\n<br>\nRegards, <br>\n\n<br>\n<b>The Gensan OSCP Team</b>');
