INSERT INTO `sys_rule_deployed` VALUES ('RUL-108b4192:15b3d234d5c:-67b1','\npackage oboassessment.ADD_PLUMBING_FEE;\nimport oboassessment.*;\nimport java.util.*;\nimport com.rameses.rules.common.*;\n\nglobal RuleAction action;\n\nrule \"ADD_PLUMBING_FEE\"\n	agenda-group \"initial\"\n	salience 50000\n	no-loop\n	when\n		\n		\n		BD: obo.facts.OboDocument (  doctype matches \"PLUMBING\" ) \n		\n	then\n		Map bindings = new HashMap();\n		\n		bindings.put(\"BD\", BD );\n		\n	Map _p0 = new HashMap();\n_p0.put( \"amount\", (new ActionExpression(\"0\", bindings)) );\n_p0.put( \"billcode\", new KeyValue(\"PLUMBING_FEE\", \"PLUMBING FEE\") );\naction.execute( \"add-billitem\",_p0,drools);\n\nend\n\n\n	'),('RUL-181817d3:15bf4e3b890:-29cc','\npackage oboassessment.FENCING_IND_MAT;\nimport oboassessment.*;\nimport java.util.*;\nimport com.rameses.rules.common.*;\n\nglobal RuleAction action;\n\nrule \"FENCING_IND_MAT\"\n	agenda-group \"compute-other-fee\"\n	salience 50000\n	no-loop\n	when\n		\n		\n		BILLITEM: treasury.facts.BillItem (  billcode matches \"FENCING_FEE\" ) \n		\n		 obo.facts.OboDecimalInfo (  name matches \"FENCE_MADE_OF_INDIGENOUS_MATERIAL\",LNM:value ) \n		\n	then\n		Map bindings = new HashMap();\n		\n		bindings.put(\"BILLITEM\", BILLITEM );\n		\n		bindings.put(\"LNM\", LNM );\n		\n	Map _p0 = new HashMap();\n_p0.put( \"billitem\", BILLITEM );\n_p0.put( \"type\", \"ADD\" );\n_p0.put( \"amount\", (new ActionExpression(\" LNM * 2.4\", bindings)) );\naction.execute( \"update-billitem-amount\",_p0,drools);\n\nend\n\n\n	'),('RUL-181817d3:15bf4e3b890:-2b06','\npackage oboassessment.FENCING_MASONRY_METAL_CONCRETE_ABOVE_1_8_M_HT;\nimport oboassessment.*;\nimport java.util.*;\nimport com.rameses.rules.common.*;\n\nglobal RuleAction action;\n\nrule \"FENCING_MASONRY_METAL_CONCRETE_ABOVE_1_8_M_HT\"\n	agenda-group \"compute-other-fee\"\n	salience 50000\n	no-loop\n	when\n		\n		\n		BILLITEM: treasury.facts.BillItem (  billcode matches \"FENCING_FEE\" ) \n		\n		 obo.facts.OboDecima